tables.table_schema:
CREATE TABLE massive_data (
  id INT PRIMARY KEY,
  data_value TEXT
);

CREATE TABLE data_info (
  info_id INT PRIMARY KEY,
  data_id INT,
  info_name VARCHAR(255),
  info_description TEXT
);

CREATE TABLE data_mapping (
  mapping_id INT PRIMARY KEY,
  data_id INT,
  mapping_type VARCHAR(50)
);

CREATE TABLE users (
    user_id INT PRIMARY KEY,
    username VARCHAR(50) NOT NULL,
    email VARCHAR(100) UNIQUE NOT NULL,
    registration_date TIMESTAMP
);

CREATE TABLE table1 (
    id INT PRIMARY KEY,
    name STRING,
    age INT
);

CREATE TABLE table2 (
    user_id INT,
    address STRING,
    city STRING
);

CREATE TABLE table3 (
    order_id INT PRIMARY KEY,
    product_name STRING,
    quantity INT
);

CREATE TABLE table4 (
    customer_id INT PRIMARY KEY,
    email STRING,
    phone_number STRING
);

CREATE TABLE table5 (
    employee_id INT PRIMARY KEY,
    department STRING,
    salary FLOAT
);
